import React, { Component } from 'react';
import Paper from '@material-ui/core/Paper';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Editor from './Editor';
import List from '@material-ui/core/List';
//import ListItem from '@material-ui/core/ListItem';
//import ListItemText from '@material-ui/core/ListItemText';
//import ListSubheader from '@material-ui/core/ListSubheader';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
//import Paper from '@material-ui/core/Paper';

let id = 0;
/*
function createData(name, calories, fat, carbs, protein) {
  id += 1;
  return { id, name, calories, fat, carbs, protein };
}
*/
function TabContainer(props) {
    return (
        <Paper style={{maxHeight:150, overflow: 'auto'}}>
          <Table >
            <TableHead>
              <TableRow>
                <TableCell>#</TableCell>
                <TableCell align="right">ARCHIVO</TableCell>
                <TableCell align="right">LINEA</TableCell>
                <TableCell align="right">COLUMNA</TableCell>
                <TableCell align="right">TIPO</TableCell>
                <TableCell align="right">DESCRIPCION</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
            <TableRow key="0">
                <TableCell component="th" scope="row">0</TableCell>
                <TableCell align="right">dsdsad</TableCell>
                <TableCell align="right">dasdasd</TableCell>
                <TableCell align="right">dasdsadas</TableCell>
                <TableCell align="right">adsadsadas</TableCell>
                <TableCell align="right">fdfdsfsd</TableCell>
            </TableRow>
            </TableBody>
          </Table>
        </Paper>
      );
}
export default class Body extends Component {

  state = {
      value: 0,
  };

  constructor(props){
      super(props);
      this.titulos = ['Consola','Heap','Stack','Errores']
      console.log("Constructor del Footer");
     console.log(this.props.styles);

  }
  handleChange = (event, value) => {
      this.setState({ value });
    };
  handlecodeChange = (code)=>{
      console.log('desde Footer:: '+code);
  }
    render() {

      const { value } = this.state;

      return (
        <Paper >

            <Tabs
              value={value}
              onChange={this.handleChange}
              indicatorColor="primary"
              textColor="primary"
              variant="scrollable"
              scrollButtons="auto"
              centered
            >
              {<Tab label={this.titulos[0]} />}
              {<Tab label={this.titulos[1]} />}
              {<Tab label={this.titulos[2]} />}
              {<Tab label={this.titulos[3]} />}

            </Tabs>

          {value === 0 && <TabContainer flag={0} oncodchange={this.handlecodeChange} info={this.props.info} handleconsole={this.props.handleconsole}></TabContainer>}
          {value === 1 && <TabContainer edd={this.props.heap} flag={1} oncodchange={this.handlecodeChange}></TabContainer>}
          {value === 2 && <TabContainer edd={this.props.stack} flag={2} oncodchange={this.handlecodeChange}></TabContainer>}
          {value === 3 && <TabContainer errores={this.props.errores}edd={this.props.stack} flag={4} oncodchange={this.handlecodeChange}></TabContainer>}

          </Paper >
      );
    }


}
